class TodoList extends Component {
    constructor(props) {
      super(props)

      this.state = {
         arrTodo:""
      }

    }

  render() {
    const arrTodo=[];
    arrTodo.push(this.props.newTask)
   var element=arrTodo.map=item=>{
      return(
        <li>{item}</li>
       )
    }
    return (
      <>
        <h3>Todo</h3>
        <ul id="incomplete-tasks">
          {()=>element}
        </ul>
      </>
    );
  }
}

export default TodoList;
